import React from 'react'
import { useAuth0 } from '@auth0/auth0-react'
import {

    Link,
    Grid,
  Typography, Pape, Box, Paper

 } from '@material-ui/core';
 import PeopleAltIcon from '@mui/icons-material/PeopleAlt';

export const HomePage = () => {

    const {isAuthenticated} = useAuth0();

    return (
        <div align="center" className='HomePage'>

<Box sx={{ width: '100%' }}>
     <Grid item xs={12} md={4} lg={3} container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
                <Paper
                  sx={{
                    p: 2,
                    display: 'flex',
                    flexDirection: 'column',
                    height: 240,
                    margin: 5,

                  }}
                >


<Typography component="p" variant="h5">  Total Patients </Typography>


      <Typography component="p" variant="h5">
        10
      </Typography>

      <div>
        <PeopleAltIcon
            style={{ fontSize: 50, color:"#3f51b5" }}
        />
      </div>

  </Paper>
              </Grid>
              </Box>

        </div>
    )
}
